import "./TodoItem.css";

class TodoItem extends Component{
    render(){
        return (
            <div className="todo-item">
                <input type="checkbox" checked = {this.props.data.completed} onChange = {()=>{console.log("changed")}}/>
                <p>{this.props.data.text}</p>
            </div>
        )
    }
}
export default TodoItem
